// export default DataInput;


const DataInput = () => {
  const [productName, setProductName] = useState('');
  const [category, setCategory] = useState('');
  const [additionalInfo, setAdditionalInfo] = useState('');
  const [description, setDescription] = useState('');
  const [features, setFeatures] = useState('');
  const [option, setOption] = useState('');


  const handleSubmit = (event) => {
    event.preventDefault();
    // Handle form submission here, e.g., send data to backend
  };


  return (
    <div>
      <h2>Data Input</h2>
      <button onClick={onBackToDashboard}>Back to Dashboard</button>
      <form onSubmit={handleSubmit}>
        <label>
          Product Name:
          <input type="text" value={productName} onChange={(e) => setProductName(e.target.value)} />
        </label>
        <br />
        <label>
          Product Category:
          <select value={category} onChange={(e) => setCategory(e.target.value)}>
            <option value="category1">Seating</option>
            <option value="category2">Desk</option>
            <option value="category3">Collaborative Workspace</option>
            <option value="category4">Tables</option>
            <option value="category5">Office Storage</option>
            <option value="category6">Sofa/ Lounges</option>
            <option value="category7">Whiteboards/ Presentation Product</option>
            <option value="category8">Hospitality Furniture</option>
            <option value="category9">Acoustic Solutions</option>
            <option value="category10">Education</option>
            <option value="category10">Other</option>
          </select>
        </label>
        <br />
        <label>
          Additional Information:
          <input type="text" value={additionalInfo} onChange={(e) => setAdditionalInfo(e.target.value)} />
        </label>
        <br />
        <label>
          Product Description:
          <textarea value={description} onChange={(e) => setDescription(e.target.value)} />
        </label>
        <br />
        <label>
          Features:
          <textarea value={features} onChange={(e) => setFeatures(e.target.value)} />
        </label>
        <br />
        <label>
          Option:
          <textarea value={option} onChange={(e) => setOption(e.target.value)} />
        </label>
        <br />
        <button type="submit">Submit</button>
      </form>
    </div>
  );
};


export default DataInput;
